// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "./ERC721r.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract KRWN is ERC721r, Ownable, ReentrancyGuard {
  using Strings for uint256;

  string public baseURI;
  string public baseExtension = ".json";
  uint256 public price = 20000000000000000;
  uint256 private platinumUpgradeCounter = 0;
  uint256 private diamondUpgradeCounter = 0;
  bool public paused = false;

  // Royalty and withdraw receiver adresses
  address public withdrawAddress = 0x3B715d4F5219510C7f77DB4388ebc0A1436B8430;
  // Royalty fee 5%

  constructor(
    string memory _initBaseURI
  ) ERC721r("KRWN", "KRWN", 8891) {
    setBaseURI(_initBaseURI);
  }

  // Returns a link to IPFS storage
  function _baseURI() internal view virtual returns (string memory) {
    return baseURI;
  }

  // Returns a link to contract metadata
  function contractURI() public pure returns (string memory) {
        return "https://bafkreighdqctgobot4wdhrnrvqdvv3axhvfisllc5r55m2ajwwgvgvn7sq.ipfs.nftstorage.link/";
    }

  // Public mint
  function mint(uint256 tokenNum) external payable nonReentrant{
    uint256 supply = totalSupply();
    require(!paused);
    require(supply+1 <= maxSupply, "All tokens are minted");
    require(price*tokenNum == msg.value, "Insufficient funds");
    
    _mintRandom(msg.sender, tokenNum);
    withdraw();
  }

  function upgradePlatinumBundle() public nonReentrant{
    uint256 ownerTokenCount = balanceOf(msg.sender);
    require(ownerTokenCount >= 10, "Not enough tokens to upgrade");
    require(platinumUpgradeCounter <= 20, "All slots are over");

    uint256[] memory tokens = walletOfOwner(msg.sender);

    for(uint256 i = 0; i < 10; i++){
      transferFrom(msg.sender, address(this), tokens[i]);
    }

    platinumUpgradeCounter++;
  }

  function upgradeDiamondBundle() public nonReentrant{
    uint256 ownerTokenCount = balanceOf(msg.sender);
    require(ownerTokenCount >= 30, "Not enough tokens to upgrade");
    require(diamondUpgradeCounter <= 10, "All slots are over");

    uint256[] memory tokens = walletOfOwner(msg.sender);

    for(uint256 i = 0; i < 30; i++){
      transferFrom(msg.sender, address(this), tokens[i]);
    }

    diamondUpgradeCounter++;
  }

  function sendUpgradedToken(address _to, uint256 _tokenId) public onlyOwner{
     _mint(_to, _tokenId);
  }

  function walletOfOwner(address _owner)
    public
    view
    returns (uint256[] memory)
  {
    uint256 ownerTokenCount = balanceOf(_owner);
    uint256[] memory tokenIds = new uint256[](ownerTokenCount);
    for (uint256 i; i < ownerTokenCount; i++) {
      tokenIds[i] = tokenOfOwnerByIndex(_owner, i);
    }
    return tokenIds;
  }

  // Token metadata
  function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
  {
    require(
      _exists(tokenId),
      "ERC721Metadata: URI query for nonexistent token"
    );
    

    string memory currentBaseURI = _baseURI();
    return bytes(currentBaseURI).length > 0
        ? string(abi.encodePacked(currentBaseURI,"Hoodie%20", tokenId.toString(), baseExtension))
        : "";
  }

  // Returns current token price
  function getTokenPrice() public view returns(uint256) {
    return price;
  }

  // Sets token price
  function setTokenPrice(uint256 _price) public onlyOwner {
    price = _price;
  }

  // Sets IPFS link
  function setBaseURI(string memory _newBaseURI) public onlyOwner {
    baseURI = _newBaseURI;
  }

  // Sets Base Extension
  function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
    baseExtension = _newBaseExtension;
  }

  // Pause contract
  function pause(bool _state) public onlyOwner {
    paused = _state;
  }
  
  // Returns "True" if the token exists, and "False" otherwise
  function exists(uint256 tokenId) public view returns(bool){
    return _exists(tokenId);
  }

  // Withdrawing contract balance to withdrawAddress
  function withdraw() private {
    (bool os, ) = payable(withdrawAddress).call{value: address(this).balance}("");
    require(os);
  }

  // Burns token
  function _burn(uint256 tokenId) internal virtual override {
      super._burn(tokenId);
      _resetTokenRoyalty(tokenId);
    }

  function burnNFT(uint256 tokenId) public onlyOwner{
    _burn(tokenId);
  }
}

